import React from 'react';
import HeroImage from '../assets/images/player-hero.svg';

function HeroSection() {
    return (
        <section className='flex justify-between items-center py-24 px-52'>
            <ul className='w-2/5'>
                <li><h1 className='text-6xl font-bold'>Learn SQL the Fun Way: Play Games, Earn Badges, Master Queries!</h1></li>
                <li><p className='text-gray-600 mt-4 mb-8 text-lg'>Turn SQL learning into an engaging adventure with interactive challenges, a rewarding badge system, and a supportive community.</p></li>
                <li>
                    <a href='' className='custom-btn'>Sign Up for Free</a>
                    <a href='' className='ms-5 text-primary'>Learn more</a>
                </li>
                <li></li>
            </ul>
            <img src={HeroImage} alt='' className='w-3/5 ' />
        </section>
    );
}

export default HeroSection;
